RuleEditorInstanceCtrl = function($scope, $modalInstance, originalRules, dataSourceId, tierNames, $druid) {
  $scope.originalRules = originalRules;
  $scope.rules = angular.copy(originalRules);
  $scope.dataSourceId = dataSourceId;
  $scope.tierNames = tierNames;
  $scope.updateRuleType = function(i, innerScope) {
    var rule;
    rule = $scope.rules[i];
    if (rule.timeType !== rule.type.substr(4)) {
      switch (rule.type.substr(4)) {
        case 'ByPeriod':
          innerScope.ruleForm.period.$setValidity('isoDuration', true);
          rule.period = '';
          break;
        case 'ByInterval':
          innerScope.ruleForm.interval.$setValidity('isoInterval', true);
          rule.interval = '';
      }
      switch (rule.timeType) {
        case 'Forever':
          rule.momentInterval = moment.interval("P100Y/2100");
          break;
        default:
          delete rule.momentInterval;
      }
      console.log("rule.timeType isnt rule.type.substr(4)", rule);
    }
    rule.type = "" + rule.direction + rule.timeType;
  };
  $scope.addRule = function() {
    $scope.rules.push({
      direction: 'load',
      type: 'loadByPeriod',
      timeType: 'ByPeriod',
      tieredReplicants: {}
    });
  };
  $scope.removeRule = function(i) {
    var removed;
    removed = $scope.rules.splice(i, 1);
  };
  $scope.moveRule = function(i, where) {
    $scope.rules.splice(i + where, 0, $scope.rules.splice(i, 1)[0]);
  };
  $scope.addReplicant = function(rule, tier) {
    rule.tieredReplicants[tier] = 1;
  };
  $scope.updateReplicantCount = function(rule, tier, innerScope) {
    rule.tieredReplicants[tier] = innerScope.n;
  };
  $scope.removeReplicant = function(rule, tier) {
    delete rule.tieredReplicants[tier];
  };
  $scope.replicantsNeeded = function(rule) {
    return rule.direction === 'load' && _.isEmpty(rule.tieredReplicants);
  };
  $scope.replicantsForAll = function(sc) {
    return $scope.rules.every(function(r) {
      return !$scope.replicantsNeeded(r);
    });
  };
  $scope.save = function() {
    var rulesToSave;
    rulesToSave = $scope.rules.map(function(r) {
      var rule;
      rule = {
        type: r.type,
        tieredReplicants: r.tieredReplicants
      };
      switch (r.timeType) {
        case 'ByPeriod':
          rule.period = r.period;
          break;
        case 'ByInterval':
          rule.interval = r.interval;
      }
      return rule;
    });
    console.log("saving", rulesToSave);
    $druid.saveRules($scope.dataSourceId, rulesToSave).then((function() {
      return $modalInstance.close(rulesToSave);
    }), (function(reason) {
      return $scope.postError = reason;
    }));
  };
  $scope.reset = function() {
    $scope.rules = angular.copy(originalRules);
  };
  $scope.cancel = function() {
    $modalInstance.dismiss("cancel");
  };
};

